ਫਾਈਨਲ ਕੱਟ ਪ੍ਰੋ%{count} ਚੁਣੀ%{item} ਨੂੰ ਹੇਠ ਲਿਖੀ ਥਾਂ ਤੇ ਨਿਰਯਾਤ ਕਰੇਗਾ:

%{path}

ਹੇਠ ਲਿਖੇ ਪ੍ਰੈਸ ਦਾ ਇਸਤੇਮਾਲ ਕਰਨਾ:

%{preet}

ਜੇਕਰ ਪ੍ਰੀਸੈਟ ਇੱਕ ਆਈਟਿਊਜ਼ ਪਲੇਲਿਸਟ ਵਿੱਚ ਐਕਸਪੋਰਟ ਨੂੰ ਜੋੜ ਰਿਹਾ ਹੈ, ਤਾਂ ਡੈਸਟੀਨੇਸ਼ਨ ਫੋਲਡਰ ਨੂੰ ਅਣਡਿੱਠਾ ਕੀਤਾ ਜਾਵੇਗਾ. %{replace}

ਤੁਸੀਂ ਕਮਾਂਡਮਸਟ ਮੈਨੂਬਰ ਤਰਜੀਹਾਂ ਰਾਹੀਂ ਇਹਨਾਂ ਸੈਟਿੰਗਾਂ ਨੂੰ ਬਦਲ ਸਕਦੇ ਹੋ.

ਕਿਰਪਾ ਕਰਕੇ ਫਾਈਨਲ ਕਟ ਪ੍ਰੋ ਨੂੰ ਰੋਕ ਨਾ ਕਰੋ ਜਦੋਂ ਤੁਸੀਂ ਜਾਰੀ ਰੱਖੋ ਬਟਨ ਦਬਾਓ ਕਿਉਂਕਿ ਇਹ ਆਟੋਮੇਸ਼ਨ ਨੂੰ ਤੋੜ ਸਕਦਾ ਹੈ.
